	function fireBall(ee, ball){
		ballFired.set({ text: "true"});		
		fireBallPos = ball.position;
		backboardPos = targetClicked.position;

		ball.set({rotation:[ee.player.rotation.x, ee.player.rotation.y, ee.player.rotation.z]});
		if(backboardPos.x > ee.player.position.x){
			ball.position.set(ee.player.position.x, (ee.player.position.y), ee.player.position.z);
		} else{
			ball.position.set(ee.player.position.x, (ee.player.position.y), ee.player.position.z);
		}

		xDiff = backboardPos.x - ball.position.x;
		xInc = xDiff/10
		yDiff = backboardPos.y - ball.position.y;
		yInc = yDiff/10;
		zDiff = backboardPos.z - ball.position.z;
		zInc = zDiff/10;	
	}

	function fireRocket1(ee, rocket1){
		rocketSound.play();
		rocket1Fired.set({ text: "true"});		
		firePos1 = rocket1.position;
		targetPos1 = targetClicked.position;

		if(gameActive._content.text == "false"){
			resetResults();
		}

		rocket1.set({rotation:[ee.player.rotation.x, ee.player.rotation.y, ee.player.rotation.z]});
		if(targetPos1.x > ee.player.position.x){
			rocket1.position.set(ee.player.position.x, (ee.player.position.y - 0.5), ee.player.position.z - 0.325);
		} else{
			rocket1.position.set(ee.player.position.x, (ee.player.position.y - 0.5), ee.player.position.z + 0.325);
		}

		xDiff = targetPos1.x - rocket1.position.x;
		xInc = xDiff/10
		yDiff = targetPos1.y - rocket1.position.y;
		yInc = yDiff/10;
		zDiff = targetPos1.z - rocket1.position.z;
		zInc = zDiff/10;	
	}

	function updateTime(){   
		currentTotalMilsec ++;

		if((milsecPassed == 2 || milsecPassed == 4 || milsecPassed == 6 || milsecPassed == 8 || 
			milsecPassed == 10 || milsecPassed == 12 || milsecPassed == 14 || milsecPassed == 16 || milsecPassed == 18 ||
			milsecPassed == 20 || milsecPassed == 22 || milsecPassed == 24 || milsecPassed == 26 || milsecPassed == 28) ){

			if(totalKills == 43){
				gameActive.set({ text: "false"});
			}

			if(gameActive._content.text == "false"){
				if(paintFired._content.text == "true"){ 
