			paintCube.position.set(ee.player.position.x, (ee.player.position.y - 0.5), ee.player.position.z + 0.325);
		}

		xDiff = canvasCubePos.x - paintCube.position.x;
		xInc = xDiff/10
		yDiff = canvasCubePos.y - paintCube.position.y;
		yInc = yDiff/10;
		zDiff = canvasCubePos.z - paintCube.position.z;
		zInc = zDiff/10;	
	}

